import React from "react";

export default function LeftNvbar() {
  return (
    <div>
      <div className="col-sm-2 sidenav">
        <p>
          <a href="#">Account statement</a>
        </p>
        <p>
          <a href="#">Transactions</a>
        </p>
        <p>
          <a href="#">New registrations</a>
        </p>
      </div>
    </div>
  );
}
